import React from "react";

import CategoryCard from "./categoryCard";
const Home = () => {
  return (
    <div className="w-full">
      <div className="w-full bg-footerBackground h-[630px]"></div>
      <div className="w-full my-4">
        <CategoryCard />
      </div>
    </div>
  );
};

export default Home;
